[TERM]
####################################################################
# The keyword INIFILE can be used to tell NetTerm to use the full  #
# filename contained after the keyword to get the actual location  #
# of the users netterm.ini file.  This can be used by networked    #
# based installations of NetTerm to point to a users networked     #
# based directory for their personal copy of the netterm.ini file. #
# For example, the network based directory would contain a 'model' #
# netterm.ini file containing the following sample entry:          #
#      INIFILE=O:\data\netterm\netterm.ini                         #
# In this case, NetTerm would use the netterm.ini file located on  #
# the O drive under the directory of \data\netterm for the user.   #
#                                                                  #
# If this keyword is not present, or set, NetTerm will first look  #
# within the current Windows directory, then the directory from    #
# which NetTerm was loaded to find a valid netterm.ini file.       #
#                                                                  #
INIFILE=
####################################################################
# The LANGUAGE keyword defines which National Language to use.     #
# Currently, the following are supported:                          #
#                                                                  #
# Windows 3.1, and Windows 95/NT                                   #
#                                                                  #
#      LANGUAGE=ENGLISH      English                               #
#      LANGUAGE=GERMAN       German                                #
#      LANGUAGE=SPANISH      Castilian Spanish                     #
#      LANGUAGE=BRAZIL       Brazilian Portuguese                  #
#                                                                  #
# Chinese Windows 95/NT                                            #
#                                                                  #
#      LANGUAGE=TCHINESE     Traditional Chinese                   #
#      LANGUAGE=SCHINESE     Simplified Chinese                    #
#                                                                  #
# English Windows 95/NT with Unionway or similiar product          #
#                                                                  #
#      LANGUAGE=UTC          Traditional Chinese                   #
#      LANGUAGE=USC          Simplified Chinese                    #
#                                                                  #
LANGUAGE=english
####################################################################
